css:
:host ::-webkit-scrollbar,
atom-text-editor ::-webkit-scrollbar {
  width: 0.5em;
  height: 0.5em;
}
:host ::-webkit-scrollbar-track,
atom-text-editor ::-webkit-scrollbar-track {
  background-color: #0d0d0d;
}
:host ::-webkit-scrollbar-thumb,
atom-text-editor ::-webkit-scrollbar-thumb {
  background-color: #272727;
}
:host .wrap-guide,
atom-text-editor .wrap-guide {
  background: rgba(255, 255, 255, 0.01);
}
:host .indent-guide,
atom-text-editor .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
:host,
atom-text-editor,
:host .gutter,
atom-text-editor .gutter {
  background-color: #0d0d0d;
  color: #f8f8f2;
}
:host.is-focused .cursor,
atom-text-editor.is-focused .cursor {
  border-color: #f8f8f0;
}
:host.is-focused .selection .region,
atom-text-editor.is-focused .selection .region {
  background-color: #404040;
}
:host.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
:host.is-focused .line.cursor-line,
atom-text-editor.is-focused .line.cursor-line {
  background-color: #272727;
}
:host .comment,
atom-text-editor .comment {
  color: #75715e;
}
:host .string,
atom-text-editor .string {
  color: #e6db74;
}
:host .constant.numeric,
atom-text-editor .constant.numeric {
  color: #ae81ff;
}
:host .constant.language,
atom-text-editor .constant.language {
  color: #ae81ff;
}
:host .constant.character,
atom-text-editor .constant.character,
:host .constant.other,
atom-text-editor .constant.other {
  color: #ae81ff;
}
:host .keyword,
atom-text-editor .keyword {
  color: #f92672;
}
:host .storage,
atom-text-editor .storage {
  color: #f92672;
}
:host .storage.type,
atom-text-editor .storage.type {
  font-style: italic;
  color: #66d9ef;
}
:host .entity.name.class,
atom-text-editor .entity.name.class {
  text-decoration: underline;
  color: #a6e22e;
}
:host .entity.other.inherited-class,
atom-text-editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #a6e22e;
}
:host .entity.name.function,
atom-text-editor .entity.name.function {
  color: #a6e22e;
}
:host .variable.parameter,
atom-text-editor .variable.parameter {
  font-style: italic;
  color: #fd971f;
}
:host .entity.name.tag,
atom-text-editor .entity.name.tag {
  color: #f92672;
}
:host .entity.other.attribute-name,
atom-text-editor .entity.other.attribute-name {
  color: #a6e22e;
}
:host .support.function,
atom-text-editor .support.function {
  color: #66d9ef;
}
:host .support.constant,
atom-text-editor .support.constant {
  color: #66d9ef;
}
:host .support.type,
atom-text-editor .support.type,
:host .support.class,
atom-text-editor .support.class {
  font-style: italic;
  color: #66d9ef;
}
:host .invalid,
atom-text-editor .invalid {
  color: #f8f8f0;
  background-color: #f92672;
}
:host .invalid.deprecated,
atom-text-editor .invalid.deprecated {
  color: #f8f8f0;
  background-color: #ae81ff;
}
